import { PostList } from "./components/PostsLists"
import {Routes, Route} from "react-router-dom"

function App() {
    return (
        <div className="container">
        <Routes>
            <Route path="/" element = {<PostList />}/>
            <Route path="/posts/:id" element = {null}/>
        </Routes>
        </div>
    ) 
}

export default App
